SE REQUIERE SERVICIO DE LIMPIEZA, HIGIENIZACION Y FUMIGACIÓN EN LA OFICINA REGIONAL DE INAMI EN LA CIUDAD DE SAN PEDRO SULA, DEPARTAMENTO DE CORTES, QUE INCLUYA LAS SIGUIENTES ACTIVIDADES: 
1) Barrido y trapeado de piso las veces que sean necesarias para mantenerlo limpio diariamente; 
2) Limpieza e higienización de servicios sanitarios; 
3) Limpieza de paredes y puertas; 
4) Limpieza de ventanas, lámparas, microondas, refrigeradora y vidrios; 
5) Recolección y evacuación de basura; 
6) Limpieza de muebles; 
7) Limpieza y barrido de aceras; 
8) Lavado, pulido, encerado, abrillantamiento de pisos y de fachada exterior, actividad en fines de semana; 
9) Lavado en seco de todos los muebles de tela con base o shampoo apropiado, actividad cada 6 meses; 
10) Aspirado o lavado en seco de cortinas de tela, actividad cada 6 meses; 
11) Servicios de fumigación; se deberá realizar 3 veces en el año; 
12) Servicio de rodentización; 

Para este servicio se necesita contar con una persona aseadora de planta, con una horario de 08:00 am a 04:00 pm de lunes a viernes, y los días sábados en un horario de 08:00 am a 12:00 pm, deberá presentarse con su debida identificación de empresa con fotografía y nombre completo del empleado, el servicio requerido comprende desde el 01 de febrero de 2020 al 31 de diciembre de 2020.   
********Las cotizaciones deben presentarse en sobre sellado en la Gerencia Administrativa de INAMI, en las fechas indicadas, especificando el número del proceso, cualquier consulta adicional avocarse en la Gerencia Administrativa.*****FONDOS INAMI DEL FIDEICOMISO PANI-SEFIN.

