SE REQUIERE UNA OBRA CON LAS SIGUIENTES ACTIVIDADES EN EL CENTRO PEDAGÓGICO DE INTERNAMIENTO JALTEVA;  
***Act.1) Construcción de cisterna  de ladrillo rafon de una capacidad de 80mts3 incluye chapeo, limpieza, acarreo, excavación tipo 1, cimentación de mampostería con cama de 5cms, losa de concreto superior y inferior, armado varilla de 1/2" a cada 0.15 cms en ambos sentidos según diseño, tapadera metálica de 0.60x0.60 cms, repello de paredes 2cms, accesorios tanque de distribución, mortero 1/6, pulido en paredes 0.5 cms. afinado tipo pila, aplicación de impermeabilizante, pintura acrílica proporción 1/1 área grande, losa de piso reforzada 0.10 cms #3 en ambos sentidos, gradas metálicas de inspección, 2 cajas de válvulas 0.80x0.8x1.60, pared de ladrillo rafon refuerzo horizontal n2 a cada hilada y refuerzo número # 3 vertical por cada agujero de ladrillo rafon, accesorios de tubería de entrada y accesorios de salida, tubería de limpieza y de rebose, incluye accesorios para conexión de cisterna existente y nueva;  
***Act.2) Suministro e instalación de 600 ML de Tubería de 3" SDR21 línea de conducción de agua potable desde cisterna existente a pegue de tubería nuevo, incluye sustitución de tubería existente, acarreo y traslado , limpieza, excavación, y aterrado en tramo que se necesite Las tuberías deberán estar construidas en lances de una sola pieza de 20 pies de largo. El material plástico usado en la fabricación de las tuberías deberá cumplir con las propiedades físicas y químicas descritas en la norma ASTM D1784 que se refiere a las propiedades del PVC. Las tuberías deberán cumplir con los requerimientos establecidos en la norma ASTM D2241 para tubería de agua potable sujeta a presión, con una clasificación de celda 12454 (PVC 1120). Para tuberías con diámetros menores o iguales a 4 pulgadas, el sistema de conexión será con junta cementada (ASTM D2672) y para diámetros mayores o iguales a 6 pulgadas serán con junta rápida (ASTM D3139 y ASTM F477).;  
***Act.3) Remodelación de cisterna actual incluye desmontaje de estructura actual de techo, suministro y mano de obra de material, construcción de losa de techo aproximadamente 42mts, estructura de canaleta  doble enchapada de 6" lamina aluzinc cal 26, concreto 3000 lbs7pulg2 espesor minimos 3", usar impermeabilizante, resane paredes exteriores , aplicación de impermeabilizante internamente y externa, diseño y construcción de columnas(6) y zapatas aisladas (6) bases soportes de losa, gradas metálicas, tapadera  metálica 0.60x0.60 cms,entabicado de paredes para alcanzar altura de nivel de losa.;   
***Act.4) Construcción y Diseño  de 2 SistemaS Hipoclorador en Cisterna incluye: trazado y marcado, pared de ladrillo rafon, solera 0.10xo.15cms, repello de paredes 2cms, pulido en paredes 0.5 cms, afinado tipo pila, loseta tipo 1,y 2, Tapadera metálica de 0.60x0.60 accesorios de hipoclorador ver plano de diseño.; 
***Act.5) Construcción de caseta de vigilancia 3 mts x2.50, de bloque de 6" zizado, techo con canaleta y lamina de zinc, piso de firme de concreto concreto, instalación y suministro de taza campesina, ventanas de celosías, puerta metálica de 1.00x 2.10 con llavin yale, verjas metálicas para ventanas, solera inferior, castillos y solera de remate según especificación de plano, puerta metálica de 1.00mts x2.10; 
